import React from 'react'
import SimpleImageSlider from 'react-simple-image-slider'



const AboutPage = () => {

    const images = [
        {url: '../images/about_images/photo1.jpg'},
        {url: '../images/about_images/photo2.jpg'},
        {url: '../images/about_images/photo3.jpg'},
        {url: '../images/about_images/photo4.jpg'},

    ]

  return (
    <div>

        <SimpleImageSlider
        width={896}
        height={504}
        images={images}
        showBullets={true}
        showNavs={true}
        />



    </div>
  )
}

export default AboutPage
